import axios from 'axios';

const GetApi = () => {
    axios.get('http://localhost:3001/Profiles')
    .then(resolve => {
        data = resolve.data;
        data.map((element) => {
            console.log(`${element.userId},${element.name},${element.place},${element.contact}`)
        });
    })
    .catch(error => {
        console.log(error);
    });
}

export default GetApi;
